import React, {Component} from 'react';
import AboutMe from './components/AboutMe.js';
import WorkExperience from './components/WorkExperience.js';
import Projects from './components/Projects.js';
import "tachyons";

class App extends Component{

  render(){
    return (
      <div className="App">

        <div>
          YOLO
        </div>

      	<div>
          <AboutMe/>
          <WorkExperience/>
          <Projects/>
      	</div>

      </div>
    );
  }
}

export default App;
